// pages/stock/StockListPage.jsx
import { useEffect, useMemo, useState } from "react";
import { useSearchParams } from "react-router-dom";
import { useQuery } from "@tanstack/react-query";
import axios from "axios";
import SearchComponent from "../../components/SearchComponent";
import { BASE_URL } from "../../api/config";

const fetchStocks = async ({ queryKey }) => {
  const [_key, { name }] = queryKey;
  const { data } = await axios.get(`${BASE_URL}/stocks`, {
    params: name ? { name } : {},
  });
  return Array.isArray(data) ? data : data?.content ?? [];
};

export default function StockListPage() {
  const [sp, setSp] = useSearchParams();
  const initial = sp.get("name") ?? "";
  const [name, setName] = useState(initial);

  // URL 동기화 (디바운스 결과는 SearchComponent가 대신 호출)
  const handleDebounced = (debounced) => {
    const next = new URLSearchParams(sp);
    if (debounced) next.set("name", debounced);
    else next.delete("name");
    setSp(next, { replace: true });
  };

  const qk = useMemo(() => ["stocks", { name: sp.get("name") ?? "" }], [sp]);
  const { data = [], isFetching } = useQuery({ queryKey: qk, queryFn: fetchStocks, keepPreviousData: true, staleTime: 30_000 });

  // 처음 마운트 시에도 한 번 동기화
  useEffect(() => {
    if ((sp.get("name") ?? "") !== name) {
      const next = new URLSearchParams(sp);
      if (name) next.set("name", name);
      else next.delete("name");
      setSp(next, { replace: true });
    }
    // eslint-disable-next-line react-hooks/exhaustive-deps
  }, []);

  return (
    <div className="p-4">
      <div className="flex items-center gap-2 mb-4">
        <SearchComponent
          value={name}
          onChange={setName}
          onDebounced={handleDebounced}
          delay={300}
          minLength={0}
          placeholder="검색"
        />
        <button className="px-3 py-2 border rounded" onClick={() => setName("")}>초기화</button>
      </div>

      {isFetching && <div className="text-sm mb-2">검색 중...</div>}

      <table className="w-full border-collapse">
        <thead>
          <tr>
            <th className="border p-2">상품명</th>
            <th className="border p-2">현재재고</th>
            <th className="border p-2">누적입고</th>
            <th className="border p-2">누적출고</th>
          </tr>
        </thead>
        <tbody>
          {data.length ? data.map((r) => (
            <tr key={r.id ?? r.pid ?? r.productId}>
              <td className="border p-2">{r.pname ?? r.productName}</td>
              <td className="border p-2 text-right">{Number(r.currentStock ?? r.qty ?? 0).toLocaleString()}</td>
              <td className="border p-2 text-right">{Number(r.totalIn ?? 0).toLocaleString()}</td>
              <td className="border p-2 text-right">{Number(r.totalOut ?? 0).toLocaleString()}</td>
            </tr>
          )) : (
            <tr><td className="border p-4 text-center" colSpan={4}>검색 결과가 없습니다</td></tr>
          )}
        </tbody>
      </table>
    </div>
  );
}
